import React from 'react';
import styled from 'styled-components';

const Main = styled.div`
    height: 1020px;
    width: 100%;
    background-color: rgba(20, 18, 24, 0.8)

`;

const NoMatch = () => {
    return (
        <Main >
            <img src="../images/404.jpg" alt=""/>
            {/*<Link to={'/'} >efw</Link>*/}
        </Main>
    )
};

export default NoMatch;
